void MainView::addViewItem(int aid, ERMCKnobShape knob, int ax, int ay, int aw, int ah, int amin, int amax, int arange)
{
	Slider::SliderStyle style = Slider::LinearHorizontal; // to keep compiler happy
	bool createSlider = false;
	bool createButton = false;
	viewItems[aid].knob=knob;
	switch (viewItems[aid].knobToViewStyle())
	{
	case visSlider:
		style = (aw > ah)  ? Slider::LinearHorizontal : Slider::LinearVertical;
		createSlider = true;
		break;
	case visRotator:
		style = Slider::RotaryVerticalDrag;
		createSlider = true;
		break;
    case visUnknown: return;
        break;
  case visButton:
	  createButton = true;
		break;
    }
	if (createSlider)
	{
		Slider *slider = new RMCSlider("new slider", knob);
		viewItems[aid].control=slider;
		addAndMakeVisible(slider);
		slider->setRange(amin, amax, arange);
		slider->setSliderStyle(style);
		slider->setTextBoxStyle(Slider::NoTextBox, false, 80, 20);
		slider->addListener(this);
		slider->setBounds(ax,ay,aw,ah);
		slider->setLookAndFeel(&rmcLookAndFeel);
	}
	if (createButton)
	{
		ToggleButton *toggleButton = new ToggleButton("new toggle button");
		viewItems[aid].control = toggleButton;
		addAndMakeVisible(toggleButton);
		toggleButton->setButtonText(String());
		toggleButton->addListener(this);
		toggleButton->setBounds(ax, ay, 31,24); // aw, ah);
	}
}

void MainView::sliderValueChanged(Slider* sliderThatWasMoved)
{
	for (int i = 0; i<VIEWITEMCOUNT; i++)
	{
		if (sliderThatWasMoved == viewItems[i].control)
			ModelUpdateParameter(i, roundToInt(sliderThatWasMoved->getValue()));
	}
}

void MainView::buttonClicked(Button* buttonThatWasClicked)
{
		for (int i = 0; i<VIEWITEMCOUNT; i++)
		{
			if (buttonThatWasClicked == viewItems[i].control)
				ModelUpdateParameter(i, roundToInt(buttonThatWasClicked->getToggleState()));
		}
}

void MainView::timerCallback()
{
  for (int i=0;i<VIEWITEMCOUNT;i++)
    {
		if (viewItems[i].control!=nullptr)
		{
			int newValue = model->getXParameter(i);
			if (newValue == viewItems[i].value) continue;
			viewItems[i].value = newValue;
			switch (viewItems[i].knobToViewStyle())
			{
				case visSlider:
				case visRotator:
					{
						Slider *slider = dynamic_cast<Slider *>(viewItems[i].control.get());	// .get() gets the raw pointer
						slider->setValue(newValue, dontSendNotification);
					}
					break;
				case visButton:
					{
						ToggleButton *toggleButton = dynamic_cast<ToggleButton *>(viewItems[i].control.get());
						toggleButton->setToggleState(newValue!=0, dontSendNotification);
					}
					break;
			}
		}
	}
}

void MainView::ModelUpdateParameter(int id, int value)
{
	viewItems[id].value = value;
	if (model != NULL)
		model->setXParameter(id, value);
}
